// ELEMENTS
import { Grid } from '../elements/index';

// STYLE
import styled, { css } from 'styled-components';

const CommunityPost = () => {
  return (
    <Grid 
      height="30px"
      addstyle={() => {
        return css`
          margin: 15px;
          font-size: 18px;
          font-weight: bold;
        `;
       }}
       >
      9월 8일 (수) 18:00 망원 2동 순찰돕니다.
    </Grid>
  );
};

export default CommunityPost;
